// src/components/admin/dashboard/StatsOverview.jsx
import React, { useState, useEffect } from 'react';
import { Package, Users, DollarSign, Clock, TrendingUp, TrendingDown } from 'lucide-react';
import RevenueChart from './RevenueChart';
import RecentActivities from './RecentActivities';

const StatCard = ({ title, value, icon: Icon, change, trend }) => (
  <div className="bg-white p-6 rounded-lg shadow">
    <div className="flex justify-between items-start">
      <div>
        <p className="text-sm font-medium text-gray-600">{title}</p>
        <h3 className="text-2xl font-bold text-gray-900 mt-1">{value}</h3>
        {change && (
          <div className="flex items-center mt-1">
            {trend === 'up' ? (
              <TrendingUp className="w-4 h-4 text-emerald-500 mr-1" />
            ) : (
              <TrendingDown className="w-4 h-4 text-red-500 mr-1" />
            )}
            <span className={`text-sm ${trend === 'up' ? 'text-emerald-600' : 'text-red-600'}`}>
              {change}% from last month
            </span>
          </div>
        )}
      </div>
      <div className="p-3 bg-blue-50 rounded-lg">
        <Icon className="h-6 w-6 text-blue-600" />
      </div>
    </div>
  </div>
);

const StatsOverview = () => {
  const [stats, setStats] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchStats = async () => {
      try {
        const response = await fetch('/api/admin/dashboard', {
          headers: {
            'Authorization': `Bearer ${localStorage.getItem('adminToken')}`
          }
        });
        
        if (!response.ok) throw new Error('Failed to fetch dashboard data');
        
        const data = await response.json();
        setStats(data.stats);
      } catch (err) {
        setError(err.message);
      } finally {
        setLoading(false);
      }
    };

    fetchStats();
  }, []);

  if (loading) return <div className="flex justify-center items-center h-64">Loading...</div>;
  if (error) return <div className="text-red-500">Error: {error}</div>;

  return (
    <div className="space-y-6 p-6">
      <div>
        <h1 className="text-2xl font-bold text-gray-900">Dashboard Overview</h1>
        <p className="mt-1 text-sm text-gray-500">Overview of your courier system performance</p>
      </div>

      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
        <StatCard
          title="Total Shipments"
          value={stats.totalShipments}
          icon={Package}
          change={stats.shipmentGrowth}
          trend={stats.shipmentGrowth >= 0 ? 'up' : 'down'}
        />
        <StatCard
          title="Active Users"
          value={stats.activeUsers}
          icon={Users}
          change={stats.userGrowth}
          trend={stats.userGrowth >= 0 ? 'up' : 'down'}
        />
        <StatCard
          title="Monthly Revenue"
          value={`â‚¹${stats.monthlyRevenue.toLocaleString()}`}
          icon={DollarSign}
          change={stats.revenueGrowth}
          trend={stats.revenueGrowth >= 0 ? 'up' : 'down'}
        />
        <StatCard
          title="Avg Delivery Time"
          value={`${stats.avgDeliveryTime} hours`}
          icon={Clock}
          change={stats.deliveryTimeChange}
          trend={stats.deliveryTimeChange <= 0 ? 'up' : 'down'}
        />
      </div>

      <div className="grid grid-cols-1 lg:grid-cols-2 gap-6">
        <RevenueChart />
        <RecentActivities />
      </div>
    </div>
  );
};

export default StatsOverview;
